import React from 'react';
import { Link } from 'react-router-dom';
function Footer() {
  return (
    <div className='footer'>
      <p>2022 </p>
      <a
        className='fab fa-github'
        href='https://github.com/Sebastiangomezzz'
        rel='noopener noreferrer'
        target='_blank'
      >
        <i>Github</i>
      </a>
    </div>
  );
}

export default Footer;
